import escapeRegExp from './utils/escapeRegExp';

const apiError = (r) => {
    return Promise.reject({ code: null, error: String(r) });
}

const jsonOrThrow = (r) => {
    return r.ok ? r.json() : Promise.reject({ code: r.status, error: r.statusText })
};

