class NewMetricModal extends React.Component
{
    constructor(props) {
        super(props);
        this.state = {
            validated: true,
            loading: false,
            newMetric: this.getNewMetricValues(),
            baseMetrics: this.getBaseMetrics(props)
        };
        this.form = null;
    }

    componentWillReceiveProps(nextProps) {
        if(this.props.host !== nextProps.host) {
            this.setState({
                baseMetrics: this.getBaseMetrics(nextProps),
                newMetric: this.getNewMetricValues()
            });
        }
    }

    getNewMetricValues() {
        return {
            description: '',
            parent_id: null,
            unit: '',
            moving_window_duration: '',
            interval: ''
        };
    }

    getBaseMetrics = (props) => {
        let baseMetrics = [];
        if(props.host !== null) {
            const { metrics } = props.host;
            if(typeof metrics !== 'undefined') {
                metrics.forEach(metric => {
                    if(metric.parent_id === null) {
                        baseMetrics.push({
                            name: `${metric.id} (${metric.description})`,
                            value: metric.id
                        });
                    }
                });
            }
        }
        return baseMetrics;
    };

    onChange = (key, value) => {
        let newMetric = Object.assign({}, this.state.newMetric);
        newMetric[key] = value;
        this.setState({
            newMetric
        });
    };

    onClear = (key) => {
        let newMetric = Object.assign({}, this.state.newMetric);
        newMetric[key] = '';
        this.setState({
            newMetric
        });
    };

    clearModal = () => {
        this.setState({
            newMetric: this.getNewMetricValues(),
        });
        this.props.onClose();
    };

    addMetric = () => {
        if(this.form !== null) {
            this.form.validateFields((err, values) => {
                if (!err) {
                    this.props.onAddMetric(this.props.host.hostname, this.state.newMetric);
                    this.setState({
                        loading: true
                    });
                    this.form.setFieldsValue(this.getNewMetricValues());
                }
            });
        }
    };

    setFormRef = (form) => {
        this.form = form;
    };

    render() {
        const {host} = this.props;
            return (
                <Modal
                    title="Nowa metryka zoona"
                    visible={this.props.host !== null}
