import { SIGN_IN_SUCCESS, SIGN_UP_SUCCESS, SIGN_OUT, CHANGE_AUTH_SERVER, RESTORE_SESSION } from '../actions/auth';
import {
    CHANGE_MONITOR_ADDRESS,
    CHANGE_MONITOR_DESCRIPTION,
    CHANGE_MONITOR,
    ADD_MONITOR,
    REMOVE_MONITOR
} from '../actions/monitors';
import { getAuthServer, getMonitorsArray } from '../reducers';

const AUTH_SERVER_STORAGE_KEY = 'AUTH_SERVER';
const MONITORS_STORAGE_KEY = 'MONITORS';
const TOKEN_KEY = 'TOKEN';

export const getSavedAuthServer = () => {
    return localStorage.getItem(AUTH_SERVER_STORAGE_KEY) || window.DEFAULT_AUTH_SERVER;
};

export const getSavedMonitors = () => {
    const storedMonitors = localStorage.getItem(MONITORS_STORAGE_KEY);
    if (storedMonitors) {
        let parsed;
        try {
            parsed = JSON.parse(storedMonitors);
        }
        catch (err) {}
        if (parsed) {
            return parsed;
        }
    }
    return window.DEFAULT_MONITORS;
}

export default store => next => action => {

    if (action.type === SIGN_IN_SUCCESS || action.type === SIGN_UP_SUCCESS) {
        if (action.credentials.remember) {
            localStorage.setItem(TOKEN_KEY, action.payload.token);
        }
        else {
            localStorage.removeItem(TOKEN_KEY);
        }
    }

    if (action.type === SIGN_OUT) {
        localStorage.removeItem(TOKEN_KEY);
    }

    if (action.type === RESTORE_SESSION) {
        const token = localStorage.getItem(TOKEN_KEY);
        if (token) {
            action.token = token;
        }
        else {
            return;
        }
    }

    if (action.type === CHANGE_AUTH_SERVER) {
        const result = next(action);
        const server = getAuthServer(store.getState());
        if (action.server) {
            localStorage.setItem(AUTH_SERVER_STORAGE_KEY, server);
        }
        else {
            localStorage.removeItem(AUTH_SERVER_STORAGE_KEY);
        }
        return result;
    }

    else if (
        action.type === CHANGE_MONITOR_ADDRESS ||
        action.type === CHANGE_MONITOR_DESCRIPTION ||
        action.type === CHANGE_MONITOR ||
        action.type === ADD_MONITOR ||
        action.type === REMOVE_MONITOR
    ) {
        const result = next(action);
        const monitors = getMonitorsArray(store.getState());
        localStorage.setItem(MONITORS_STORAGE_KEY, JSON.stringify(monitors));
        return result;
    }

    return next(action);
};

import { isAuthTokenSet } from '../reducers';

/**
 * Catches home route and replaces it with default route for with-token or without-token state.
 * In result, you don't need to worry where to route after login / logout / etc.. - just
 * dispatch react-router-redux-ish push('/'). And OFC home routing could be accomplished in the same maneer.
 */
export default store => next => action => {
    if (action.type === '@@router/LOCATION_CHANGE' && action.payload.pathname === '/') {
        if (isAuthTokenSet(store.getState())) {
            window.history.replaceState(null, document.title, '/live');
            action.payload.pathname = '/live';
        }
        else {
            window.history.replaceState(null, document.title, '/sign-in');
            action.payload.pathname = '/sign-in';
        }
    }
    return next(action);
}

import { SIGN_IN_SUCCESS, SIGN_UP_SUCCESS, SIGN_OUT, RESTORE_SESSION } from '../actions/auth';
import { CHANGE_MONITOR_ADDRESS, CHANGE_MONITOR, ADD_MONITOR } from '../actions/monitors';
import { GET_HOSTS_SUCCESS, GET_HOSTS_FAILURE, GET_HOSTS_REQUEST, refreshHosts } from '../actions/hosts';
import { getMonitorsHostsInvalidated } from '../reducers';

const refreshTimeout = 1000 * 60 * 5;
let timeout;

const clearHostsTimeout = () => timeout && clearInterval(timeout);

export default store => next => action => {

    const result = next(action);

    if (
        action.type === SIGN_IN_SUCCESS
        || action.type === SIGN_UP_SUCCESS
        || action.type === RESTORE_SESSION
        || (action.type === CHANGE_MONITOR_ADDRESS && action.address !== action.newAddress)
        || (action.type === CHANGE_MONITOR && action.address !== action.payload.address)
        || action.type === ADD_MONITOR
        || (
            (action.type === GET_HOSTS_FAILURE || action.type === GET_HOSTS_SUCCESS)
            && !getMonitorsHostsInvalidated(store.getState())
        )
    ) {
        clearHostsTimeout();
        if (action.type !== GET_HOSTS_FAILURE && action.type !== GET_HOSTS_SUCCESS) {
            store.dispatch(refreshHosts());
        }
        timeout = setInterval(() => {
            store.dispatch(refreshHosts());
        }, refreshTimeout);
    }

    else if (action.type === SIGN_OUT || action.type === GET_HOSTS_REQUEST) {
        clearHostsTimeout();
    }

    else if (action.type === GET_HOSTS_FAILURE || action.type === GET_HOSTS_SUCCESS) {

    }

    return result;

}

import Notification from '../components/Notification';
import { SIGN_IN_SUCCESS, SIGN_UP_SUCCESS, SIGN_OUT } from '../actions/auth';
import { CHANGE_MONITOR_ADDRESS, CHANGE_MONITOR_DESCRIPTION, CHANGE_MONITOR, ADD_MONITOR } from '../actions/monitors';
import { getMonitorById } from '../reducers';

const errorToMsg = (code, error) => {
    switch (code) {
        case 400:
            return 'Formularz zosta le wypeniony';
        case 401:
            return 'Bdne dane autoryzacyjne';
        case 404:
            return 'Podany zasb nie istnieje';
        case 409:
            return 'Zasb, do ktrego prbujesz si odwoa, ju istnieje i nie moe zostaw ten sposb zmodyfikowany';
        default:
            return error;
    }
}

/**
 * Notification logic core - it's always better to hold it in one place... so here we are :)
 */
export default store => next => action => {

    if (action.error) {
        const msg = errorToMsg(action.code, action.error);
        Notification.error(msg);
    }

    else if (action.type === SIGN_IN_SUCCESS) {
        Notification.success('Zostae zalogowany poprawnie');
    }

    else if (action.type === SIGN_UP_SUCCESS) {
        Notification.success('Rejestracja przebiega pomylnie');
    }

    else if (action.type === SIGN_OUT) {
        Notification.success('Zostae wylogowany poprawnie');
    }

    // notifications with checkings

    else if (action.type === CHANGE_MONITOR_ADDRESS) {
        const target = getMonitorById(store.getState(), action.address);
        const monitorExists = getMonitorById(store.getState(), action.newAddress);
        if (!action.newAddress) {
            Notification.error('Pole z adresem monitora nie moe bypuste!');
            action.newAddress = target.address;
        }
        else if (monitorExists) {
            Notification.error('Podany nowy adres monitora ju istnieje');
            action.newAddress = target.address;
        }
    }

    else if (action.type === CHANGE_MONITOR_DESCRIPTION) {
        const target = getMonitorById(store.getState(), action.address);
        if (!action.newDescription) {
            Notification.error('Pole z opisem monitora nie moe bypuste!');
            action.newDescription = target.description;
        }
    }

    else if (action.type === CHANGE_MONITOR) {
        const target = getMonitorById(store.getState(), action.address);
        const monitorExists = getMonitorById(store.getState(), action.payload.address);
        if (!action.payload.address) {
            Notification.error('Pole z adresem monitora nie moe bypuste!');
            action.payload = target;
        }
        else if (!action.payload.description) {
            Notification.error('Pole z opisem monitora nie moe bypuste!');
            action.payload = target;
        }
        else if (monitorExists) {
            Notification.error('Podany nowy adres monitora ju istnieje');
            action.payload = target;
        }
    }

    else if (action.type === ADD_MONITOR) {
        if (!action.payload.address) {
            Notification.error('Pole z adresem monitora nie moe bypuste!');
            return;
        }
        if (!action.payload.description) {
            Notification.error('Pole z opisem monitora nie moe bypuste!');
            return;
        }
        const monitorExists = getMonitorById(store.getState(), action.payload.address);
        if (monitorExists) {
            Notification.error('Podany adres monitora ju istnieje');
            return;
        }
    }

    return next(action);

}

import { push } from 'react-router-redux';
import { SIGN_IN_SUCCESS, SIGN_UP_SUCCESS, SIGN_OUT, restoreSession, signOut } from '../actions/auth';
import { getLocation, isAuthTokenSet } from '../reducers';
import { routesAndAuthRequired } from '../routes';

export default store => next => action => {

    const isLocationChange = action.type === '@@router/LOCATION_CHANGE';
    const state = store.getState();

    if (isLocationChange || action.type === SIGN_IN_SUCCESS || action.type === SIGN_UP_SUCCESS || action.type === SIGN_OUT) {

        const nextLocation = isLocationChange ? action.payload : getLocation(state);
        const routeAuthRequired = (routesAndAuthRequired[nextLocation.pathname] || {}).auth;

        const authorized = isLocationChange ? isAuthTokenSet(state) : (action.type === SIGN_IN_SUCCESS || action.type === SIGN_UP_SUCCESS);

        if (routeAuthRequired === false && authorized === true) {
            if (isLocationChange) {
                // jak ktos przeroutuje sie np. w /login a juz jest zalogowany
                action.payload.pathname = '/';
                return next(action);
            }
            else {
                // normalne logowanie sie
                const result = next(action);
                store.dispatch(push('/'));
                return result;
            }
        }

        else if (routeAuthRequired === true && authorized === false) {

            if (isLocationChange) {
                // jak ktos chce routowac tam gdzie nie powinien - przywracanie sesji itd
                store.dispatch(restoreSession());
                const restored = isAuthTokenSet(store.getState());
                if (!restored) {
                    action.payload.pathname = '/';
                }
                return next(action);
            }
            else {
                // normalne wylogowanie sie
                const result = next(action);
                store.dispatch(push('/'));
                return result;
            }
        }

    }

    else if (action.code === 401 && isAuthTokenSet(state)) {
        store.dispatch(signOut());
    }

    return next(action);

}

